WaShop::WaShop()
{

	Init();
	DrawOwnScn();

}

WaShop::~WaShop()
{
}

void WaShop::Update(Vector2 offset)
{

	mOffset = { offset.x_,offset.y_ };

}

void WaShop::DrawOwnScn()
{

	for (int y = 0; y < MAP_Y; y++)
	{
		for (int x = 0; x < MAP_X; x++)
		{
			

			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[ws_floor[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[ws_obj[y][x]], true);
			/*DrawFormatString(32 * x - mOffset.X, 32 * y - mOffset.Y, GetColor(255, 255, 255), "%d", mMap[y][x]);*/

		}
	}

}

bool WaShop::Init(void)
{

	if (LoadDivGraph("./image/A123.png", 4560, 30, 152, 32, 32, &mChipImage[0]) == -1)
	{
		return false;
	}

	return true;
}

bool WaShop::CheckMapChip(Vector2 pos)
{
	
	layer1 = ws_floor[pos.y_ / 16][pos.x_ / 16];
	layer2 = ws_obj[pos.y_ / 16][pos.x_ / 16];
	

	bool flg = true;	//true=player

		//s
	switch (layer1)
	{
	case -1:

		flg=true;
		break;
	default:
		break;
	}

	return flg;

}

int WaShop::GetMapChip(Vector2 pos)
{
	return ws_obj[pos.y_ / 32][pos.x_ / 32];
}
